import React from "react"; 
import "./Personality.css";

const Personality = () => {
    return (
        <React.Fragment>
            <h1>Personality Page</h1>
            <div className='main-container'>
            <span className='text'>Personality</span>
            <div className='wrapper' />
            <div className='group'>
                <span className='text-2'>Almost there ^^</span>
            </div>
            <div className='pic' />
            </div>
        </React.Fragment>
    )

   
};
export default Personality
